export const editarInformeOrina= (id) => api4.put(`/orina/${id}/edit`)
export const editarInformePrueba = (id) => api5.put(`/prueba/${id}/edit`)
export const editarInformePresencial = (id) => api5.put(`/presencial/${id}/edit`)
